function getLinkColor(value) {
    // Example logic: color links based on distance values
    const num = parseFloat(value);
    if (num < 0.001) return '#2ECC71';     // green
    if (num < 0.01) return '#F1C40F';       // yellow
    if (num < 0.1) return '#E67E22';        // orange
    return '#E74C3C';                       // red
}


